import React, {useState, useEffect} from "react";

function App() {

  const [photos, getPhotos] = useState([])

  useEffect(() => {
    fetch('http://0.0.0.0:5050/')            
    .then(res => res.json())
    .then(data => setPhotos(data))
  }, [])

  return (
    <div className="App">
      <header className="App-header">
        <h1>My Flickr App</h1>
      </header>
    </div>
  );
}

export default App;
